import React, { useState, useEffect } from "react";
import Papa from "papaparse";
import hotelData from "./clean_hotel_data.json";
import "./Hotels.css";
import NavBar from "../NavBar/Navbar";

// List of local images to randomize
const hotelImages = [
  require("./hotel.jpg"),
  require("./hotel1.jpg"),
  require("./hotel2.jpg"),
  require("./hotel3.jpg"),
  require("./hotel4.jpg"),
  require("./hotel5.jpeg"),
  require("./hotel6.jpg"),
  require("./hotel7.jpg"),
  require("./hotel8.jpeg"),
  require("./hotel9.jpg"),
  require("./hotel10.jpg"),
  require("./hotel11.jpeg"),
  require("./hotel12.jpg"),
  require("./hotel13.jpg"),
  require("./hotel14.jpg"),
  require("./hotel15.jpeg"),
];

const getRandomImage = () => hotelImages[Math.floor(Math.random() * hotelImages.length)];

const Hotels = () => {
  const [hotelsByCity, setHotelsByCity] = useState({});
  const [ratings, setRatings] = useState({});

  useEffect(() => {
    // Fetch and parse CSV file for ratings
    fetch("./ratings.csv")
      .then((response) => response.text())
      .then((csvText) => {
        Papa.parse(csvText, {
          header: true,
          skipEmptyLines: true,
          complete: (result) => {
            const ratingsMap = {};
            result.data.forEach(({ name, rating, category }) => {
              if (name && rating) {
                ratingsMap[name.trim()] = {
                  rating: parseFloat(rating).toFixed(1), // Ensure ratings are formatted to 1 decimal place
                  category: category || "General", // Default category if missing
                };
              }
            });
            setRatings(ratingsMap);
          },
        });
      });
  }, []);

  useEffect(() => {
    if (Object.keys(ratings).length === 0) return;

    const enrichedHotels = hotelData.map((hotel) => ({
      ...hotel,
      rating: ratings[hotel.name]?.rating || "N/A", // Use CSV rating if available
      category: ratings[hotel.name]?.category || hotel.category,
      address: hotel.address && hotel.address.trim() !== "" ? hotel.address : hotel.city, // Use city as fallback if address is missing
    }));

    const groupedHotels = enrichedHotels.reduce((acc, hotel) => {
      const { city } = hotel;
      if (!acc[city]) acc[city] = [];
      acc[city].push(hotel);
      return acc;
    }, {});

    // Sort by rating (highest first) and keep only top 10
    Object.keys(groupedHotels).forEach((city) => {
      groupedHotels[city] = groupedHotels[city]
        .filter((hotel) => hotel.rating !== "N/A") // Filter out hotels without ratings
        .sort((a, b) => b.rating - a.rating)
        .slice(0, 10);
    });

    setHotelsByCity(groupedHotels);
  }, [ratings]);

  const scroll = (id, direction) => {
    const container = document.getElementById(id);
    if (container) {
      container.scrollBy({ left: direction === "left" ? -300 : 300, behavior: "smooth" });
    }
  };

  return (
    <div className="hotels-container">
      <NavBar />
      {Object.entries(hotelsByCity).map(([city, hotels]) => (
        <div key={city} className="city-section">
          <h2 className="city-title">Hotels in {city}</h2>
          <div className="scroll-container">
            <button className="scroll-btn left" onClick={() => scroll(city, "left")}>←</button>
            <div className="hotels-row" id={city}>
              {hotels.map((hotel) => (
                <div key={hotel.id} className="hotel-card">
                  <img src={getRandomImage()} alt={hotel.name} className="hotel-image" />
                  <h3>{hotel.name}</h3>
                  <p className="hotel-address">{hotel.address}</p>
                  <p>⭐ {hotel.rating} ({hotel.category})</p>
                </div>
              ))}
            </div>
            <button className="scroll-btn right" onClick={() => scroll(city, "right")}>→</button>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Hotels;
